import { createContext } from "react";

const user = {
    name: "Tolu",
    username: "Tolu007"
}

export const userContext = createContext(user)

const userProvider = ({children}) => {


    return <userContext.Provider>
        {children}
    </userContext.Provider>
}


export default userProvider
